import "./Home.css";
import React from 'react';
import CouplePhoto from "../../images/us.jpg";

function Home() {
  return (
    <div className="containerH">
      <div className="header-section">
        <h2 className="subtitle">We're Getting Married</h2>
        <h1 className="names">Anna & Dominic</h1>
      </div>
      <div className="content-section">
        <div className="text-section">
          <div className="date">Saturday, August 15, 2026</div>
          <div className="location">Baywood Greens, Delaware</div>
          <div className="rsvp-button">RSVP</div>
        </div>
        <div className="image-section">
          <img src={CouplePhoto} alt="Couple Photo" className="couple-photo" />
        </div>
      </div>
    </div>
  )
}

export default Home;
